import { useEffect, useState} from 'react';
import axios from 'axios';

function List() {

  const [tapu, setTapu] = useState([]);
  const [isLoading, setIsloading] = useState(true); 

  useEffect(()=>{
    axios("https://2696e52c-ce6f-43cc-bbbe-46850ab2d273.mock.pstmn.io//api")
      .then((res) => setTapu(res.data))
      .catch((e) => console.log(e))
      .finally(() => setIsloading(false));
}, []);

  return (
    <div>
      {
        tapu.map((tapus)=>(
          <ul key={tapus.id}>
            <li>{tapus.name}</li>
            <li>{tapus.rank}</li>
            <li>{tapus.location}</li>
            <li>{tapus.url}</li>
          </ul>
        ))
      }
    </div>
  )
}

export default List;
